(14, 1, '2020-11-05 09:38:35', '2020-11-05 09:38:35', '<section id=\'about\' class=\"fw-main-row s-about bg-light\">\n	<div class=\"fw-container\">\n		<div class=\"fw-row\">\n	<div class=\"fw-col-xs-12 section-header\">\n	<h2>Обо мне</h2>    <div class=\'s-descr-wrap\'>\n    <div class=\'s-descr\'>\n        \n        Познакомимся ближе    </div>\n    </div>\n\n</div>\n</div>\n\n<div class=\"fw-row\">\n	<div class=\"fw-col-xs-12 fw-col-sm-4 order-md-0 animation-2\">\n	<h3>Немного о себе</h3><p>Далеко-далеко за словесными горами в стране, гласных и согласных живут рыбные тексты.</p><p>Грустный диких буквоград текст назад использовало даль строчка это эта приставка запятых. Грустный семь от всех необходимыми, вопроса текст прямо большого.</p></div>\n<div class=\"fw-col-xs-12 fw-col-sm-4 order-md-1 animation-1\">\n	<div class=\"fw-team\">\n	<div class=\"fw-team-image person\">\n                    <h3>Фото</h3>\n                <a href=\"//wp.gd/app/wp-content/uploads/2020/11/photo.jpg\" class=\'popup\'>\n        <img src=\"//wp.gd/app/wp-content/uploads/2020/11/photo.jpg\" alt=\"Фото\" />\n        </a>\n    </div>\n</div>\n\n</div>\n<div class=\"fw-col-xs-12 fw-col-sm-4 order-md-2 animation-3\">\n	<br /><h3>Персональная информация</h3><h2 class=\"personal_header\">Коваль Ирина</h2><ul><li>Профессиональное создание сайтов: разработка дизайна, HTML верстка, посадка на CMS WordPress</li><li>Номер телефона: +7 999 999 99 99</li><li>E-mail: <a href=\"mailto:youmail@mail.ru\">youmail@mail.ru</a></li><li>Веб-сайт: <a href=\"https://www.upwork.com/o/profiles/users/_~01bc7e84cb8498ab4c/\" target=\"_blank\" rel=\"noopener noreferrer\">My Upwork </a></li></ul>    <a href=\"#\">\n<span class=\"fw-icon\">\n	<i class=\"fa fa-twitter\"></i>\n	</span>\n    </a>\n    <a href=\"#\">\n<span class=\"fw-icon\">\n	<i class=\"fa fa-facebook\"></i>\n	</span>\n    </a>\n    <a href=\"#\">\n<span class=\"fw-icon\">\n	<i class=\"fa fa-vk\"></i>\n	</span>\n    </a>\n</div>\n</div>\n\n	</div>\n</s