(66, 1, '2020-11-25 13:37:16', '2020-11-25 13:37:16', 'Почему он используется?\r\nДавно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации \"Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..\" Многие программы электронной вёрстки и редакторы HTML используют Lorem Ipsum в качестве текста по умолчанию, так что поиск по ключевым словам \"lorem ipsum\" сразу показывает, как много веб-страниц всё ещё дожидаются своего настоящего рождения. За прошедшие годы текст Lorem Ipsum получил много версий. Некоторые версии появились по ошибке, некоторые - намеренно (например, юмористические варианты).', 'Дизайн лендинг страницы', '', 'inherit', 'closed', 'closed', '', '64-revision-v1', '', '', '2020-11-25 13:37:16', '2020-11-25 13:37:16', '', 64, 'http://wp.gd/app/2020/11/25/64-revision-v1/', 0, 'revision', '', 0),
