ose\" type=\"button\" title=\"Закрыть (Esc)\">×</button>\n                    <h3>Заголовок работы 2</h3>\n                    <p>Откуда он появился?<br />\nМногие думают, что Lorem Ipsum &#8212; взятый с потолка псевдо-латинский набор слов, но это не совсем так. Его корни уходят в один фрагмент классической латыни 45 года н.э., то есть более двух тысячелетий назад. Ричард МакКлинток, профессор латыни из колледжа Hampden-Sydney, штат Вирджиния, взял одно из самых странных слов в Lorem Ipsum, &#171;consectetur&#187;, и занялся его поисками в классической латинской литературе. В результате он нашёл неоспоримый первоисточник Lorem Ipsum в разделах 1.10.32 и 1.10.33 книги &#171;de Finibus Bonorum et</p>\n                    <img src=\"http://wp.gd/app/wp-content/uploads/2020/11/bacata.png\" alt=\"Заголовок работы 2\" />\n                </div>\n            </div>\n        </div>\n\n	</div>\n    <div class=\"mix col-md-3 col-4 portfolio-item grid-item  \">\n        <img width=\"467\" height=\"1024\" src=\"http://wp.gd/app/wp-content/uploads/2020/11/site.jpg\" class=\"attachment-post-thumbnail size-post-thumbnail wp-post-image\" alt=\"\" loading=\"lazy\" />        <div class=\"port-item-cont\">\n            <div class=\"wrapper\">\n            <h3>Дизайн лендинг страницы</h3>\n            <p>Почему он используется? Давно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации &#171;Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..&#187; Многие программы электронной [&hellip;]</p>\n            <a href=\"#\" class=\"popup-content\">Просмотреть</a>\n            </div>\n        </div>\n        <div class=\"hidden\">\n            <div class=\"port-descr\">\n                <div class=\"modal-box-content\">\n                    <button class=\"mfp-close\" type=\"button\" title=\"Закрыть (Esc)\">×</button>\n                    <h3>Дизайн лендинг страницы</h3>\n                    <p>Почему он используется?<br />\nДавно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации &#171;Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..&#187; Многие программы электронной вёрстки и редакторы HTML используют Lorem Ipsum в качестве текста по умолчанию, так что поиск по ключевым словам &#171;lorem ipsum&#187; сразу показывает, как много веб-страниц всё ещё дожидаются своего настоящего рождения. За прошедшие годы текст Lorem Ipsum получил много версий. Некоторые версии появились по ошибке, некоторые &#8212; намеренно (например, юмористические варианты).</p>\n                    <img src=\"http://wp.gd/app/wp-content/uploads/2020/11/site.jpg\" alt=\"Дизайн лендинг страницы\" />\n                </div>\n            </div>\n        </div>\n\n	</div>\n	<!-- post navigation-->\n        </div>\n    </div>\n</div>\n</div>\n</div>\n\n	</div>\n</section>\n<section id=\'contacts\' class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"fw-row\">\n	<div class=\"fw-col-xs-12 section-header\">\n	<h2>Контакты</h2>    <div class=\'s-descr-wrap\'>\n    <div class=\'s-descr\'>\n        \n        Оставьте ваше сообщение    </div>\n    </div>\n\n</div>\n</div>\n\n<div class=\"fw-row\">\n	<div class=\"fw-col-xs-12 fw-col-sm-6 contact-box\">\n	    <div class=\'contants-icon icon-basic-geolocalize-01\'>\n        \n            </div>\n\n<h3>Адрес:</h3><p>Город герой Рашков ПМР молдова</p></div>\n<div class=\"fw-col-xs-12 fw-col-sm-6 contact-box\">\n	<div class=\"form-wrapper fw-contact-form contact-form\">\n	<div class=\"wrap-forms\">\n	<div class=\"fw-row\"></div><div class=\"fw-row\"><div class=